import React, { Component } from 'react'
import './Tasks.css';

export class Tasks extends Component {

    constructor(){
        super();
        this.state = {
            customers: []
        }
    }
    
    componentDidMount(){
        fetch('/api/customers')
            .then(res => res.json())
            .then(customers => this.setState({customers} , () => console.log('customer fethed...' , customers) ));
    }

    render() {
        return (
            <div className="container" >

                <h1>Taks</h1>
                <table className='table table-striped table-bordered'>
                    <thead className="thead-dark">
                        <th className='col'>#</th>
                        <th className='col'>Task Name</th>
                        <th className='col'>Created date</th>
                        <th className='col'>Show</th>
                        <th className='col'>Edit</th>
                        <th className='col'>Delete</th>
                        <th className='col'>Created by</th>
                    </thead>

                </table>
            </div>
        );
    }
}
const taskHeader = {
    color: 'rgb(51, 51, 51)',
}
const containerStyle = {
    maxWidth: '1440px',
    paddingRight: '15px',
    paddingleft: '15px',
    marginright: 'auto',
    marginLeft: 'auto'
}



export default Tasks;
